<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
    <script>
        let A=[7,2,5,3,5,3]
        let B=[7,2,5,4,6,3,5,3]
        let C =[]
        let check =false
        for (let i = 0; i<B.length;i++){
            check=false;
            for(let j = 0; j<A.length;j++){
                if(B[i]===A[j]){
                    check=true
                }
            }
            if (check!=true){
                C.push(B[i])
            }
        }
        alert(C)
    </script>
</body>
</html>
